// Load font
require("Font7x11Numeric7Seg").add(Graphics);
// Define clock position
const X = 132, Y = 172;
const BG_HGM = require("heatshrink").decompress(atob(""))
const BG_HGM_COVER = require("heatshrink").decompress(atob(""))

function draw() {
  var d = new Date();
  var h = d.getHours(), m = d.getMinutes();
  var time = (" "+h).substr(-2) + ":" + m.toString().padStart(2,0);
  // Reset the state of the graphics library
  g.reset().setColor("#000");
  // draw the current time (4x size 7 segment)
  g.setFont("7x11Numeric7Seg", 4);
  g.setFontAlign(1, 1); // align right bottom
  g.drawString(time, X, Y, false);
  // draw the seconds (2x size 7 segment)
  g.setFont("7x11Numeric7Seg",2);
  g.drawString(("0"+d.getSeconds()).substr(-2), X+30, Y, false);
}

g.setTheme({bg:"#000",fg:"#FFF",dark:true}).clear();
Bangle.setUI("clock");
Bangle.loadWidgets();
Bangle.drawWidgets();

var toggle=true;
setInterval(function(){
  if (toggle) {
    g.drawImage(BG_HGM);
  } else {
    g.drawImage(BG_HGM); // Remove this eventually
    g.drawImage(BG_HGM_COVER, 0, 96);
  }
  toggle=!toggle;
  draw();
  Bangle.drawWidgets();
}, 1000);